To decide if S ⇒* t22 t71 t75 t79 t50, we run CYK on the length‑5 input:

1.  Single‐token spans (i.e. length 1) give exactly one NT each:
   position 1 “t22” ⇒ {NT2}  
   position 2 “t71” ⇒ {NT22}  
   position 3 “t75” ⇒ {NT74}  
   position 4 “t79” ⇒ {NT75}  
   position 5 “t50” ⇒ {NT36}  

2.  For every span of length 2, say covering tokens at positions i and i+1, we look for a rule A → BC where B is in the NT‐set of token i and C in that of token i+1.  One checks:

   – span [1,2]: {NT2}×{NT22} → no A→NT2 NT22  
   – span [2,3]: {NT22}×{NT74} → no A→NT22 NT74  
   – span [3,4]: {NT74}×{NT75} → no A→NT74 NT75  
   – span [4,5]: {NT75}×{NT36} → no A→NT75 NT36  

   So all length‑2 cells are empty.

3.  Since no length‑2 cell has any nonterminal, no larger spans can ever become nonempty. In particular, span [1,5] remains empty, so S ∉ cell[1,5].

Hence the grammar does *not* generate t22 t71 t75 t79 t50.  
No

I used the CYK algorithm.  Denoting the 6 input tokens by positions 1…6:

1: t17  ⇒ {NT3, NT59}  
2: t12  ⇒ {NT49}  
3: t14  ⇒ {NT31, NT5}  
4: t14  ⇒ {NT31, NT5}  
5: t71  ⇒ {NT22}  
6: t8   ⇒ {NT18, NT0}

Building up:

length 2 spans:
(3,4) ⇒ {NT25}        because NT25→NT31 NT5  
(5,6) ⇒ {NT44}        because NT44→NT22 NT18  

length 3 spans:
(2,4) ⇒ {NT68}        because NT68→NT49 NT25  

length 5 span (2,6):
  combine (2,4)={NT68} with (5,6)={NT44}  
    ⇒ NT77 by NT77→NT68 NT44  

Finally S→NT3 NT77 applies to  
  span (1,1)={NT3} and (2,6)={NT77}.  

Hence the full string is generated.  

Yes

I used the CYK algorithm.  First, each position in the 10‐token string yields only the nonterminals that directly produce that single terminal:

pos1 t73: {NT15}  
pos2 t18: {NT23}  
pos3 t70: {NT17}  
pos4 t75: {NT74}  
pos5 t65: {NT20}  
pos6 t78: {NT70, NT22}  
pos7 t24: {NT50}  
pos8 t8 : {NT18, NT0}  
pos9 t74: {NT49}  
pos10 t9: {NT54}  

When we attempt to build spans of length 2 (by checking every pair of adjacent NTs against the grammar’s binary productions), none of the ten adjacent pairs matches any right‐hand side of a binary rule.  Hence no nonterminal covers any length‐2 substring, so larger spans (including the full span needed for S→NT3 NT77) also stay empty.  Therefore S cannot derive the string.  

No
